import React from 'react';
import { motion } from "framer-motion";
import { header, leterOne, leterTwo, leterThree, navRow, rowLink, banner, summary, certTitle } from './Animations';
import { FaTwitter, FaLinkedin, FaGithubSquare, FaDice, FaHtml5, FaCss3Alt, FaJsSquare, FaReact, FaJava, FaAndroid, FaDocker, FaAdobe, FaGitAlt, FaLinux, FaWindows, FaMailBulk, FaPhoneSquareAlt, FaSteam, FaDev, FaInstagramSquare, FaPython, FaFigma } from 'react-icons/fa';
import { Player } from 'video-react';
import profilePicture from '../assets/profile-photo.png';
import { NavRow } from './NavRow';
import { HRHeader } from './HRHeader';
import { HRDanger } from './HRDanger';

export const Landing = () => {

    const openInNewTab = (url) => {
        var win = window.open(url, '_blank');
        win.focus();
      }

    return (
        <motion.section className='container'>
        <motion.button className='toggle' variants={leterOne} initial='init' animate='after'><FaDice size='50px' /></motion.button>
            <HRHeader />
            <NavRow />
            <HRDanger />
        </motion.section>
    )
}
